import React, { useContext } from 'react';
import myContext from '../../context/myContext';
import { Form, Modal, Button } from 'react-bootstrap';

function SearchModal() {
  const { showModal, setShowModal } = useContext(myContext);

  return (
    <Modal
      show={ showModal }
      onHide={ () => setShowModal(false) }
      backdrop="static"
      keyboard={ false }
    >
      <Modal.Header closeButton>
        <Modal.Title>
          Pesquisar!
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Por nome</Form.Label>
          <Form.Control type="email" placeholder="digite nome do vinho" />
          <Button variant="success" type="submit">
            pesquisar...
          </Button>
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Por país</Form.Label>
          <Form.Control type="email" placeholder="digite nome do país" />
          <Button variant="success" type="submit">
            pesquisar...
          </Button>
        </Form.Group>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="danger" onClick={ () => setShowModal(false) }>
          Fechar
        </Button>
      </Modal.Footer>
    </Modal>
  );
}

export default SearchModal;
